import React from 'react';
import './progress.scss';
import {Box, useTheme} from '@mui/material'
import { tokens } from '../theme/theme';


export default function Progress() {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);

  return (
    <Box>
        <Box className='progress__container'>
            <Box sx={{background: colors.redAccent[500]}} className='progress__steps'>ERFC</Box>
            <Box className='progress__steps'>HSE</Box>
            <Box className='progress__steps'>Commissioning</Box>
            <Box className='progress__steps'>SAP</Box>
            <Box className='progress__steps'>LOTO</Box>
            <Box className='progress__steps'>AP</Box>
        </Box>
    </Box>
  )
}
